insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 1, 258, '생각보다 한적했던 춘천', '요즘 스멀스멀 떠오르고 있는 인제의 자작나무 숲! 곧게 서있는 하얀 나무들 사이에 있으면 이게 진정한 힐링! 숲 속의 아카시아 향기도 좋다구. 또 야생화들이 가득한 곰배령 트래킹도 인제의 빠질 수 없는 코스 중 하나지. 뷰가 너무 멋지기로 유명하니까 인제에 들른다면 꼭 방문하기를 추천!', '2020-02-09', 'N', 4, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 2, 500, '좋아서 세 번이나 다녀온 원주', '태백은 한창 뜨거웠던 드라마 태양의 후예 촬영지로도 유명하지만 그전부터 아름다운 곳이었어. 드라마 용팔이를 포함해 많은 곳에 노출된 적 있는 바람의 언덕은 강릉의 목장만큼이나 예쁘지! 또 여름이면 해바라기 축제가 열려 노란색으로 물드는 구와우마을도 꼭 가보자!', '2020-02-16', 'N', 5, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 3, 193, '김포로 당일치기? 1박2일 모두좋아요', '한반도 지형으로 유명한 영월은 다들 지리 교과서에서 한 번쯤은 봤을 거야. 스카이워크에서 내려다보는 뷰도 아름답지만 요즘에는 한반도 지형을 보며 내려갈 수 있는 짚라인도 생겼고, 또 패러글라이딩을 할 수도 있어! 패러글라이딩은 별마루 천문대에서 잘 보이니까 구경해도 좋을 거야~', '2020-02-19', 'N', 8, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 4, 230, '생각보다 한적했던 춘천', '한국의 나폴리라고 불리는 삼척의 장호항은 바다가 워낙 맑고 투명해서 스노클링도 가능하다고 하지! 또 장미 축제는 얼마 전에 끝났지만 삼척 장미공원에서 색색의 예쁜 장미들을 볼 수 있어. 생각보다 큰 규모에 놀란다고 하더라!', '2020-02-13', 'Y', 3, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 5, 201, '바다도 좋지만 목장은 더 좋았던 강릉', '한반도 지형으로 유명한 영월은 다들 지리 교과서에서 한 번쯤은 봤을 거야. 스카이워크에서 내려다보는 뷰도 아름답지만 요즘에는 한반도 지형을 보며 내려갈 수 있는 짚라인도 생겼고, 또 패러글라이딩을 할 수도 있어! 패러글라이딩은 별마루 천문대에서 잘 보이니까 구경해도 좋을 거야~', '2020-02-08', 'N', 4, 'tour.png');
