insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 19, 351, '바다도 좋지만 목장은 더 좋았던 강릉', '한국의 나폴리라고 불리는 삼척의 장호항은 바다가 워낙 맑고 투명해서 스노클링도 가능하다고 하지! 또 장미 축제는 얼마 전에 끝났지만 삼척 장미공원에서 색색의 예쁜 장미들을 볼 수 있어. 생각보다 큰 규모에 놀란다고 하더라!', '2020-03-08', 'N', 4, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 20, 242, '생각보다 한적했던 춘천', '한국의 나폴리라고 불리는 삼척의 장호항은 바다가 워낙 맑고 투명해서 스노클링도 가능하다고 하지! 또 장미 축제는 얼마 전에 끝났지만 삼척 장미공원에서 색색의 예쁜 장미들을 볼 수 있어. 생각보다 큰 규모에 놀란다고 하더라!', '2020-04-16', 'N', 8, 'tour.png');
