insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 22, 64, '푸른 바다를 어디에서나 볼 수 있었던 통영', '한반도 지형으로 유명한 영월은 다들 지리 교과서에서 한 번쯤은 봤을 거야. 스카이워크에서 내려다보는 뷰도 아름답지만 요즘에는 한반도 지형을 보며 내려갈 수 있는 짚라인도 생겼고, 또 패러글라이딩을 할 수도 있어! 패러글라이딩은 별마루 천문대에서 잘 보이니까 구경해도 좋을 거야~', '2020-04-11', 'N', 0, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 23, 176, '김포로 당일치기? 1박2일 모두좋아요', '한국의 나폴리라고 불리는 삼척의 장호항은 바다가 워낙 맑고 투명해서 스노클링도 가능하다고 하지! 또 장미 축제는 얼마 전에 끝났지만 삼척 장미공원에서 색색의 예쁜 장미들을 볼 수 있어. 생각보다 큰 규모에 놀란다고 하더라!', '2020-04-20', 'Y', 2, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 24, 283, '좋아서 세 번이나 다녀온 원주', '태백은 한창 뜨거웠던 드라마 태양의 후예 촬영지로도 유명하지만 그전부터 아름다운 곳이었어. 드라마 용팔이를 포함해 많은 곳에 노출된 적 있는 바람의 언덕은 강릉의 목장만큼이나 예쁘지! 또 여름이면 해바라기 축제가 열려 노란색으로 물드는 구와우마을도 꼭 가보자!', '2020-04-06', 'Y', 5, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 25, 430, '좋아서 세 번이나 다녀온 원주', '너무나도 예쁜 색감의 바다가 있는 곳이 바로 속초! 아름다운 푸른빛의 천진해변, 그리고 아바이마을의 잔잔하고 작은 바닷가까지, 뿐만 아니라 물회부터 아바이순대까지 먹고 와야 할 음식들도 많다는 거~ 올여름 휴양지는 속초로 떠나보는 게 어때?', '2020-04-15', 'N', 3, 'tour.png');
