insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 43, 15, '생각보다 한적했던 춘천', '한반도 지형으로 유명한 영월은 다들 지리 교과서에서 한 번쯤은 봤을 거야. 스카이워크에서 내려다보는 뷰도 아름답지만 요즘에는 한반도 지형을 보며 내려갈 수 있는 짚라인도 생겼고, 또 패러글라이딩을 할 수도 있어! 패러글라이딩은 별마루 천문대에서 잘 보이니까 구경해도 좋을 거야~', '2020-06-22', 'N', 6, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 44, 353, '정말 사진 찍으러 가기 좋은 곳!', '태백은 한창 뜨거웠던 드라마 태양의 후예 촬영지로도 유명하지만 그전부터 아름다운 곳이었어. 드라마 용팔이를 포함해 많은 곳에 노출된 적 있는 바람의 언덕은 강릉의 목장만큼이나 예쁘지! 또 여름이면 해바라기 축제가 열려 노란색으로 물드는 구와우마을도 꼭 가보자!', '2020-06-06', 'N', 2, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 45, 138, '서울에서도 이런 녹림을 즐길 수 있네요', '태백은 한창 뜨거웠던 드라마 태양의 후예 촬영지로도 유명하지만 그전부터 아름다운 곳이었어. 드라마 용팔이를 포함해 많은 곳에 노출된 적 있는 바람의 언덕은 강릉의 목장만큼이나 예쁘지! 또 여름이면 해바라기 축제가 열려 노란색으로 물드는 구와우마을도 꼭 가보자!', '2020-06-10', 'N', 3, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 46, 454, '푸른 바다를 어디에서나 볼 수 있었던 통영', '요즘 스멀스멀 떠오르고 있는 인제의 자작나무 숲! 곧게 서있는 하얀 나무들 사이에 있으면 이게 진정한 힐링! 숲 속의 아카시아 향기도 좋다구. 또 야생화들이 가득한 곰배령 트래킹도 인제의 빠질 수 없는 코스 중 하나지. 뷰가 너무 멋지기로 유명하니까 인제에 들른다면 꼭 방문하기를 추천!', '2020-06-09', 'Y', 4, 'tour.png');
