insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 88, 125, '바다도 좋지만 목장은 더 좋았던 강릉', '너무나도 예쁜 색감의 바다가 있는 곳이 바로 속초! 아름다운 푸른빛의 천진해변, 그리고 아바이마을의 잔잔하고 작은 바닷가까지, 뿐만 아니라 물회부터 아바이순대까지 먹고 와야 할 음식들도 많다는 거~ 올여름 휴양지는 속초로 떠나보는 게 어때?', '2020-11-19', 'N', 3, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 89, 374, '서울에서도 이런 녹림을 즐길 수 있네요', '너무나도 예쁜 색감의 바다가 있는 곳이 바로 속초! 아름다운 푸른빛의 천진해변, 그리고 아바이마을의 잔잔하고 작은 바닷가까지, 뿐만 아니라 물회부터 아바이순대까지 먹고 와야 할 음식들도 많다는 거~ 올여름 휴양지는 속초로 떠나보는 게 어때?', '2020-11-06', 'Y', 8, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 90, 36, '정말 사진 찍으러 가기 좋은 곳!', '춘천은 남이섬으로 알려지기 시작해서 지금은 사진 찍기 좋은 근교 여행지로 유명하지? 산토리니 카페와 빈티지한 육림랜드, 또 유럽을 떠오르게 하는 제이드가든까지! 가까운 게 최고 장점인 춘천이니까 언제든지 가볍게 다녀오기 좋을 거야!', '2020-11-08', 'N', 4, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 91, 392, '좋아서 세 번이나 다녀온 원주', '한반도 지형으로 유명한 영월은 다들 지리 교과서에서 한 번쯤은 봤을 거야. 스카이워크에서 내려다보는 뷰도 아름답지만 요즘에는 한반도 지형을 보며 내려갈 수 있는 짚라인도 생겼고, 또 패러글라이딩을 할 수도 있어! 패러글라이딩은 별마루 천문대에서 잘 보이니까 구경해도 좋을 거야~', '2020-11-24', 'Y', 9, 'tour.png');
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp, picture) values(seqMyTour.nextVal, 92, 348, '푸른 바다를 어디에서나 볼 수 있었던 통영', '요즘 스멀스멀 떠오르고 있는 인제의 자작나무 숲! 곧게 서있는 하얀 나무들 사이에 있으면 이게 진정한 힐링! 숲 속의 아카시아 향기도 좋다구. 또 야생화들이 가득한 곰배령 트래킹도 인제의 빠질 수 없는 코스 중 하나지. 뷰가 너무 멋지기로 유명하니까 인제에 들른다면 꼭 방문하기를 추천!', '2020-12-16', 'Y', 7, 'tour.png');
